import { Fragment } from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import Input from '@mui/material/Input';
import FormControl from '@mui/material/FormControl';
import FormHelperText from '@mui/material/FormHelperText';
import InputAdornment from '@mui/material/InputAdornment';
import SearchIcon from '@mui/icons-material/Search';
import Box from '@mui/material/Box';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const Overview = () => {
    return (
        <Fragment>
            <CssBaseline />
            <Container maxWidth="lg" style={{backgroundColor: 'gray'}}>
                <Grid container>
                    <Grid item xs={7} />
                    <Grid item xs={5}>
                        <FormControl variant="standard" sx={{ mb: 3, mt: 5, width: '100%', minWidth: '5ch' }}>
                            <Input
                                id="standard-adornment-search"
                                endAdornment={<SearchIcon position="end"></SearchIcon>}
                                aria-describedby="standard-search-helper-text"
                                inputProps={{
                                'aria-label': 'Search',
                                }}
                            />
                            <FormHelperText id="standard-search-helper-text">Search Tasks / Outputs / Date</FormHelperText>
                        </FormControl>
                    </Grid>
                    <Grid item xs={12}>
                        <Box>
                            <Accordion>
                                <AccordionSummary
                                expandIcon={<ExpandMoreIcon />}
                                aria-controls="panel1a-content"
                                id="panel1a-header"
                                >
                                <Typography>Accordion 1</Typography>
                                </AccordionSummary>
                                <AccordionDetails>
                                <Typography>
                                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
                                    malesuada lacus ex, sit amet blandit leo lobortis eget.
                                </Typography>
                                </AccordionDetails>
                            </Accordion>
                            <Accordion>
                                <AccordionSummary
                                expandIcon={<ExpandMoreIcon />}
                                aria-controls="panel2a-content"
                                id="panel2a-header"
                                >
                                <Typography>Accordion 2</Typography>
                                </AccordionSummary>
                                <AccordionDetails>
                                <Typography>
                                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
                                    malesuada lacus ex, sit amet blandit leo lobortis eget.
                                </Typography>
                                </AccordionDetails>
                            </Accordion>
                            <Accordion disabled>
                                <AccordionSummary
                                expandIcon={<ExpandMoreIcon />}
                                aria-controls="panel3a-content"
                                id="panel3a-header"
                                >
                                <Typography>Disabled Accordion</Typography>
                                </AccordionSummary>
                            </Accordion>
                        </Box>
                    </Grid>
                </Grid>
            </Container>
        </Fragment>
    )
}

export default Overview;
